import React from 'react';
import { Works, Contact, Footer, Header } from './containers';
import { Navbar } from './components';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';


const App = () => {
  return (
    <div className='App'>
      <div>
        <Navbar />
        <Header /> 
      </div>
      <Works />
      <Contact />
      <Footer />
    </div>

  )
}

export default App
